DROP TABLE IF EXISTS `real_estates`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `real_estates` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `adress_id` int(10) unsigned DEFAULT NULL,
  `owner_id` int(10) unsigned DEFAULT NULL,
  `seller_id` int(10) unsigned DEFAULT NULL,
  `header` varchar(40) NOT NULL,
  `description` text NOT NULL,
  `size` decimal(8,2) DEFAULT NULL COMMENT 'quadratmeter',
  `cost` decimal(8,2) DEFAULT NULL COMMENT 'preis',
  `running_cost` decimal(8,2) DEFAULT NULL COMMENT 'nebenkosten',
  `isActive` tinyint(1) DEFAULT '0',
  `build_at` datetime DEFAULT NULL COMMENT 'maybe change to varchar/number for year',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `rooms` int(10) unsigned DEFAULT NULL,
  `energy_efficiency` varchar(2) DEFAULT 'NA',
  PRIMARY KEY (`id`),
  KEY `real_estates_adress_id_foreign` (`adress_id`),
  KEY `real_estates_owner_id_index` (`owner_id`),
  KEY `real_estates_seller_id_index` (`seller_id`),
  KEY `real_estates_energy_efficiency_index` (`energy_efficiency`),
  CONSTRAINT `real_estates_adress_id_foreign` FOREIGN KEY (`adress_id`) REFERENCES `adresses` (`id`),
  CONSTRAINT `real_estates_owner_id_foreign` FOREIGN KEY (`owner_id`) REFERENCES `users` (`id`),
  CONSTRAINT `real_estates_seller_id_foreign` FOREIGN KEY (`seller_id`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=31 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

